window.bookSummaryJSON = "<p>A town of magic and danger, where what one dons becomes who they are. </p> <p>A desperate priestess in another world calling for a champion, only to receive an unstoppable monster. </p> <p>A night of joy and giving, of grudges and combat, all as the winter snow falls. </p> <p>Between grand adventures, what mishaps may occur in the world of the Villains' Code? These are the smaller selections, short sagas within the greater story. </p> <p>These are the Villains' Vignettes.</p>"; 
